SELECT MIN(title.id), MIN(movie_info.movie_id), MIN(movie_link.movie_id), MIN(comp_cast_type.kind), MIN(aka_title.movie_id), MIN(title.production_year), MIN(title.title), MIN(complete_cast.movie_id), MIN(movie_info_idx.info) FROM title, comp_cast_type, movie_info_idx, complete_cast, movie_link, aka_title, movie_info WHERE title.title IN ('(#1.10)', '(#1.5)', 'Eine Allerweltsgeschichte', 'Zweedse rapsodie', 'El Señor Presidente', 'Shipshape-Less', '(#1.4)', 'A Visita da Velha Senhora', '(#1.8)', '51º edición de los premios Ondas', '(#1.3)', '(#1.7)', '(#1.1)', '(#1.2)', '(#1.9)', 'Star Power', '(#1.6)', '(#2.127)', 'The Boardroom', 'Song 25') AND title.production_year NOT BETWEEN 1931 AND 1935 AND comp_cast_type.kind IS NULL AND movie_info_idx.info IS NOT NULL AND title.id = movie_link.movie_id AND title.id = aka_title.movie_id AND title.id = complete_cast.movie_id AND movie_info.movie_id = title.id;